import React, { Component } from 'react';
import { Navbar, Nav, Row, Col, Container } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import './NavigacijaPocetna.css';

export default class NavigacijaPocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<Navbar className="navbar-expand navigacija-pocetna navbar-dark justify-content-between">
					<Container fluid>
						<Navbar.Text>
							<a className="navigacija-pocetna-linkovi text-black-50 postavi-oglas-link mr-4" href="#">
								Postavi oglas
							</a>
							<a className="navigacija-pocetna-linkovi text-black-50" href="#">
								Hitni oglasi
							</a>
						</Navbar.Text>
						<Navbar.Text>
							<a className="navigacija-pocetna-linkovi text-black-50" href="#">
								Prijavi se
							</a>
						</Navbar.Text>
					</Container>
				</Navbar>
			</React.Fragment>
		);
	}
}
